// import React from "react";
import "../index.css";

function Navbar() {
  const contactus = () => {
    return <h1>please contact for business</h1>;
  };
  return (
    <div className="nav-bar">
      <h3>Home</h3>
      <h3>About</h3>
      <h3 Onclick={contactus}>Contact us</h3>
    </div>
  );
}

export default Navbar;
